import { Global } from "@emotion/react";
const Fonts = () => (
  <Global
    styles={`
      /* latin */
      @font-face {
        font-family: 'Chenyuluoyan';
        src: url('../Fonts/ChenYuluoyan-Thin-Monospaced.ttf') format('ttf');
        font-style: normal;
      }
      @font-face {
        font-family: 'GenSenRounded-M';
        src: url('../Fonts/GenSenRounded-M.ttc') format('ttc');
        font-style: normal;
      }
      `}
  />
);

export default Fonts;
